    <script>
        document.getElementById('tipe_potongan').addEventListener('change', function () {
            var selectedValue = this.value;
            if (selectedValue === '1') {
                document.getElementById('tampil-persen').style.display = 'block';
                document.getElementById('tampil-nominal').style.display = 'none';
                document.getElementById('nominal').disabled = true;
                document.getElementById('persen').disabled = false;
            } else {
                document.getElementById('tampil-persen').style.display = 'none';
                document.getElementById('tampil-nominal').style.display = 'block';
                document.getElementById('persen').disabled = true;
                document.getElementById('nominal').disabled = false;
            }
        });
    </script>

